import React from 'react';
import AnimatedMenu from '../components/AnimatedMenu';

const AnimatedMenuPage = () => {
  return (
    <div className="animated-menu-page">
      <AnimatedMenu />
    </div>
  );
};

export default AnimatedMenuPage;
